import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";
import img from "../../img/html5.png";

const HomeConts3 = () => {
  return (
    <FullpageSection>
      <div className="homeWrapper3">
        <h1 className="title">
          MY <span>SKILLS</span>
        </h1>
        <div className="stacksList">
          <ul>
            <li>
              <img src={img} />
            </li>
            <li>CSS</li>
            <li>JS</li>
            <li>REACT</li>
          </ul>
        </div>
      </div>
    </FullpageSection>
  );
};

export default HomeConts3;
